INSERT INTO `blog` VALUES (1,'2018-02-01 08:09:41','mengelola-pegawai-itu-sulit','Mengelola Pegawai Itu Sulit','<p>Mengelola pegawai itu sulit !!. Begitulah keluh para pengusaha yang saya kenal. Ya,saya pun sebagai seorang founder merasakan hal tersebut. Banyak hal yang harus kita pikirkan saat memiliki pegawai,mulai dari gaji yang tepat,bagaimana performa pegawai kita,bagaimana kontribusi pegawai untuk perusahaan,dan banyak hal lain.</p><p>Seiring waktu berjalan,klien kami makin sulit untuk mengetahui pegawai mana yang benar benar berkontribusi nyata bagi perusahaan dan mana yang memiliki performa yang kurang baik. Dan sebagai perusahaan yang bergerak di bidang software house,kami mulai&nbsp;membuat software HRD untuk klien kami. Kami membuat software HRD dengan cara pemakaian sesederhana mungkin untuk klien kami pakai. Yang paling penting,mereka bisa melihat performa pegawai dengan jelas.</p><p>Setelah berjalan selama beberapa saat,kami mulai bisa melihat bagaimana review tiap pegawai. Bagaimana sikap mereka, bagaimana penjualan mereka, apa yang telah mereka sukses kerjakan, apa kesalahan yang telah mereka lakukan,dan banyak hal lainnya. Sehingga klien kami bisa memberikan bonus dan kenaikan gaji bagi pegawai yang tepat dan berhak menerimanya. Karena kami yakin,happy employees make a happy company.&nbsp;</p><p>Beberapa klien kami yang lain&nbsp; pun mencoba untuk memakai Software HRD yang telah kami buat,dan mendapat kesan positif. Hal tersebut membuat saya berfikir untuk menjadikan Software HRD ini menjadi produk yang dapat di pakai banyak perusahaan. Setelah melakukan pengembangan selama beberapa saat, lahirlah <a href=\"http://easyhrd.com\">EASYHRD</a>.&nbsp;Software HRD yang sangat sederhana namun memiliki fungsi yang sangat berguna bagi perusahaan. Dan sekarang<a href=\"http://easyhrd.com\"> EASYHRD</a>&nbsp;telah tersedia bagi seluruh perusahaan di Indonesia. Saya harap dapat membantu mengembangkan perusahaan anda dengan lebih baik lagi.&nbsp;</p><p>&nbsp;</p><p>I Putu Nata Adhikusuma</p><p>Founder <a href=\"http://easyhrd.com\">EASYHRD</a></p><p>&nbsp;&nbsp;</p><p>&nbsp;</p>','mengelola_bisnis.png');
